       if(calgrad)
           % Calculate all the bending energy control point derivatives.
           DP11=-(1/4725)*P41+(23/3600)*P42+(13/525)*P21-(947/25200)*P22-(37/1050)*P23-(19/1575)*P31-(37/1050)*P32+(1/25)*P33-(19/1575)*P13+(289/18900)*P11+(13/525)*P12+(23/3150)*P43+(31/75600)*P44-(1/4725)*P14+(23/3150)*P34+(23/3600)*P24;
           DP12=(23/3150)*P44+(23/3600)*P41+(1753/25200)*P43+(1397/6300)*P12+(16/225)*P13-(947/25200)*P21-(373/3150)*P22-(6731/25200)*P23-(37/1050)*P31-(47/525)*P32+(89/1050)*P33+(13/525)*P11+(73/1050)*P42-(19/1575)*P14+(1/25)*P34-(37/1050)*P24;
           DP13=(1397/6300)*P13-(37/1050)*P21-(6731/25200)*P22-(373/3150)*P23+(1/25)*P31+(89/1050)*P32-(47/525)*P33+(1753/25200)*P42+(16/225)*P12-(19/1575)*P11+(23/3600)*P44+(13/525)*P14-(37/1050)*P34-(947/25200)*P24+(23/3150)*P41+(73/1050)*P43;
           DP14=(23/3150)*P42+(31/75600)*P41+(289/18900)*P14+(13/525)*P24-(37/1050)*P22-(19/1575)*P34+(23/3150)*P31-(947/25200)*P23-(37/1050)*P33-(19/1575)*P12+(13/525)*P13-(1/4725)*P44+(1/25)*P32-(1/4725)*P11+(23/3600)*P21+(23/3600)*P43;
           DP21=-(37/1050)*P13-(947/25200)*P12+(13/525)*P11+(1/25)*P43-(19/1575)*P41+(1397/6300)*P21-(373/3150)*P22-(47/525)*P23+(16/225)*P31-(6731/25200)*P32+(89/1050)*P33-(37/1050)*P42+(23/3150)*P44+(23/3600)*P14+(1753/25200)*P34+(73/1050)*P24;
