           DP31=(1/25)*P13-(37/1050)*P12-(19/1575)*P11+(89/1050)*P23+(1397/6300)*P31-(373/3150)*P32-(47/525)*P33+(16/225)*P21-(6731/25200)*P22-(947/25200)*P42+(13/525)*P41-(37/1050)*P43+(23/3600)*P44+(23/3150)*P14+(73/1050)*P34+(1753/25200)*P24;
           DP32=(89/1050)*P13-(47/525)*P12-(37/1050)*P11+(7963/6300)*P32-(439/3150)*P33-(3443/25200)*P23-(373/3150)*P31-(947/25200)*P41-(6731/25200)*P21-(439/3150)*P22-(373/3150)*P42-(6731/25200)*P43-(37/1050)*P44+(1/25)*P14-(47/525)*P34+(89/1050)*P24;
           DP33=-(47/525)*P13+(89/1050)*P12+(1/25)*P11-(37/1050)*P41-(439/3150)*P32-(439/3150)*P23-(47/525)*P31+(7963/6300)*P33-(373/3150)*P43+(89/1050)*P21-(3443/25200)*P22-(6731/25200)*P42-(37/1050)*P14-(373/3150)*P34-(6731/25200)*P24-(947/25200)*P44;
           DP34=(23/3600)*P41-(37/1050)*P42-(19/1575)*P14+(1397/6300)*P34+(16/225)*P24+(89/1050)*P22+(73/1050)*P31-(6731/25200)*P23-(373/3150)*P33+(1/25)*P12-(37/1050)*P13-(47/525)*P32+(23/3150)*P11+(1753/25200)*P21+(13/525)*P44-(947/25200)*P43;
           DP41=-(1/4725)*P11+(23/3600)*P12-(19/1575)*P43-(37/1050)*P33-(19/1575)*P21+(1/25)*P23+(23/3150)*P24-(37/1050)*P22-(947/25200)*P32+(23/3600)*P34+(13/525)*P42+(13/525)*P31+(289/18900)*P41+(31/75600)*P14-(1/4725)*P44+(23/3150)*P13;
           DP42=(23/3600)*P11+(1753/25200)*P13+(1397/6300)*P42+(13/525)*P41-(373/3150)*P32-(6731/25200)*P33-(947/25200)*P31+(89/1050)*P23+(16/225)*P43-(47/525)*P22-(37/1050)*P21+(23/3150)*P14-(19/1575)*P44-(37/1050)*P34+(1/25)*P24+(73/1050)*P12;
           DP43=(1753/25200)*P12+(1/25)*P21-(19/1575)*P41-(47/525)*P23-(373/3150)*P33+(89/1050)*P22-(6731/25200)*P32+(16/225)*P42-(37/1050)*P31+(1397/6300)*P43+(23/3150)*P11-(37/1050)*P24-(947/25200)*P34+(23/3600)*P14+(13/525)*P44+(73/1050)*P13;
           DP44=(23/3150)*P12+(23/3600)*P13+(289/18900)*P44-(37/1050)*P32+(23/3150)*P21-(19/1575)*P42-(37/1050)*P23+(23/3600)*P31+(31/75600)*P11-(19/1575)*P24+(1/25)*P22-(1/4725)*P14+(13/525)*P34+(13/525)*P43-(1/4725)*P41-(947/25200)*P33;

