for i=1:size(O,1)-3;
    for j=1:size(O,2)-3;
        for k=1:size(O,3)-3;
            % Get the control points of one grid cell
            P111=O(i+0,j+0,k+0); P112=O(i+0,j+0,k+1); P113=O(i+0,j+0,k+2); P114=O(i+0,j+0,k+3);
